import { createRouter, createWebHistory } from 'vue-router'
import Home from "@/views/Userviews/Booking";
import UserCenter from "@/views/Userviews/UserCenter";
import HistoryOrder from "@/views/Userviews/HistoryOrder";
import Schedule from "@/views/Managerviews/Schedule";
import Movies from "@/views/Managerviews/Movies";
import Login from "@/views/Login";

const routes = [
  {
    path: '/login',
    name: 'login',
    component: Login
  },
  {
    path: '/register',
    name: 'register',
    component: Register
  },
  {
    path: '/booking',
    name: 'booking',
    component: Home
  },
  {
    path: '/usercenter',
    name: 'usercenter',
    component: UserCenter
  },
  {
    path: '/historyorder',
    name: 'historyorder',
    component: HistoryOrder
  },
  {
    path: '/schedule',
    name: 'schedule',
    component: Schedule
  },
  {
    path: '/movies',
    name: 'movies',
    component: Movies
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
